//Display.js

import React from "react"

/* Title function header*/
function Title(){
	return(
	<div>
	<h1> Magic Minutes! </h1> 
 	</div>
	)
}

/* Today function paragraph*/
function Today(){
	return(
	<div>
	<p> Today </p>
 	</div>
	)
}

/* Title and List function*/
function TitleAndList(){
	return(
		<div>
		<Title/>
		<List/>
		</div>
		)
}


/* List function*/
function List(){
	return (
		<ul>
	<li>1</li>
	<li>2</li>
	<li>3</li>
	</ul>
	)
}

export default Display
